import React from 'react'
import styled from 'styled-components'
const Header = () => {
  return (
    <StContainer>
        <StHeaderContainer>
            <StLogo><img src="//contents-image.twayair.com/homepage/images/common/top_logo.png" alt="" /></StLogo>
            <StNavBox>
                <StNavContainer>
                    <li>항공권예매</li>
                    <li>나의 예약</li>
                    <li>서비스안내</li>
                    <li>온라인면세점</li>
                    <li>이벤트</li>
                    <li>제휴</li>
                </StNavContainer>
            </StNavBox>
            <div>
                <p>나의페이지</p>
                <p>검색</p>
                <p>햄버거 버튼</p>
            </div>
        </StHeaderContainer>
    </StContainer>
  )
}

export default Header
const StContainer = styled.div`
    border-bottom: 1px solid #000;
`
const StLogo = styled.h1`
    width: 101px;
    height: 42px;
`
const StNavBox = styled.nav`
    width: 820px;
    margin-left:60px;
    box-sizing: border-box;
`
const StHeaderContainer = styled.header`
    width: 1200px;
    margin:  0 auto;
    height: 85px;

    display: flex;
`
const StNavContainer = styled.ul`
    display: flex;
    list-style: none;
    justify-content: space-between;
    align-items: center;
`
